import React, { useState,useEffect } from 'react';
import axios from 'axios';

const Registration = () => {
  const [fullName, setFullName] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [higherUniversity, setHigherUniversity] = useState('');
  const [higherDegree, setHigherDegree] = useState('');
  const [higherMajor, setHigherMajor] = useState('');
  const [higherGraduationYear, setHigherGraduationYear] = useState('');
  const [posts, setPosts] = useState([]);

//   const Registeration = async () => {
//     try {
//       let item = [fullName, contactNumber, email, password, higherUniversity, higherDegree, higherMajor, higherGraduationYear];
//       console.warn(item);
//       let result = await fetch("http://localhost:8000/api/users", {
//         method: "POST",
//         body: JSON.stringify(item),
//         headers: {
//           "Content-type": 'application/json',
//           "Accept": 'application/json'
//         }
//       });
//       result = await result.json();
//       console.warn("result", result);
//     } catch (error) {
//       console.error("Registration failed:", error);
//     }
//   };
// useEffect(() => {
//     axios.get('http://localhost:8000/api/users')
//       .then(response => {
//         setPosts(response.data);
//       })
//       .catch(error => {
//         console.error(error);
//       });
//   }, []);
const [userData, setUserData] = useState({
    name: fullName,
    email: email,
    user_number:contactNumber,
    higher_university:higherUniversity,
    higher_degree: higherDegree,
    higher_major:higherMajor,
    higher_graduation: higherGraduationYear,
    password: password,
  });

  const handlePostData = () => {
    axios.post('YOUR_API_ENDPOINT', userData)
      .then(response => {
        console.log('User data posted:', response.data);
        // Handle success, update state or show a success message
      })
      .catch(error => {
        console.error('Error posting user data:', error);
        // Handle error, show an error message, etc.
      });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await Registeration();
  };

  return (
    <form onSubmit={handlePostData}>
      <h3>Sign Up</h3>

      <div className="row">
        {/* Personal Details */}
        <div className="col-md-6 mb-3">
          <label>Full Name</label>
          <input
            type="text"
            className="form-control"
            placeholder="Full name"
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
          />
        </div>
        <div className="col-md-6 mb-3">
          <label>Contact Number</label>
          <input
            type="text"
            className="form-control"
            placeholder="Contact number"
            value={contactNumber}
            onChange={(e) => setContactNumber(e.target.value)}
          />
        </div>
      </div>

      <div className="row">
        <div className="col-md-6 mb-3">
          <label>Email address</label>
          <input
            type="email"
            className="form-control"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        <div className="col-md-6 mb-3">
          <label>Password</label>
          <input
            type="password"
            className="form-control"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
      </div>

      <div className="mb-3">
        <h4>Higher Education Details</h4>
        <div className="row">
          {/* Higher University Field */}
          <div className="col-md-6 mb-3">
            <label>Higher University</label>
            <input
              type="text"
              className="form-control"
              placeholder="Higher university name"
              value={higherUniversity}
              onChange={(e) => setHigherUniversity(e.target.value)}
            />
          </div>
          {/* Higher Degree Field */}
          <div className="col-md-6 mb-3">
            <label>Higher Degree</label>
            <select
              className="form-control"
              value={higherDegree}
              onChange={(e) => setHigherDegree(e.target.value)}
            >
              <option value="">Select Higher Degree ↓</option>
              <option value="doctorate">Doctorate</option>
              <option value="masters">Masters</option>
              <option value="post-graduate-diploma">Post Graduate Diploma</option>
            </select>
          </div>
        </div>

        <div className="row">
          {/* Higher Major Field */}
          <div className="col-md-6 mb-3">
            <label>Higher Major</label>
            <input
              type="text"
              className="form-control"
              placeholder="Higher major"
              value={higherMajor}
              onChange={(e) => setHigherMajor(e.target.value)}
            />
          </div>
          {/* Higher Graduation Year Field */}
          <div className="col-md-6 mb-3">
            <label>Higher Graduation Year</label>
            <input
              type="text"
              className="form-control"
              placeholder="Higher graduation year"
              value={higherGraduationYear}
              onChange={(e) => setHigherGraduationYear(e.target.value)}
            />
          </div>
        </div>
      </div>

      <div className="d-grid">
        <button type="submit" className="btn btn-primary">
          Sign Up
        </button>
      </div>

      <p className="forgot-password text-right">
        Already registered <a href="/sign-in">sign in?</a>
      </p>
    </form>
  );
};

export default Registration;
